import { useLocation,useNavigate } from "react-router-dom"
import React from "react"
import { useState } from "react"
export default function Home(){
    const navigate = useNavigate()
    const location = useLocation()
    let [userstate,setstate] = useState({})
    if (localStorage.getItem("jsontoken"))
    {
        const options ={
            method:'POST',
            header:{
                'Content-Type':'application/json',
                'jsontoken':localStorage.getItem("jsontoken")
            }
        }
        fetch('http://127.0.0.1/verifyjwt',options).then(res=>res.json()).then(data=>{
            console.log(data)
        })
    return navigate("/")
    }
    if (!location.state){
        userstate = setstate(location.state)
        localStorage.setItem("jsontoken",userstate.jsontoken)
        return <>
<h1>Your Userid for login is = {userstate.userid} Note on Paper</h1>
        
</>
    }
    
}
